  const [cities, setCities] = useEffect(() => {
    fetch("https://assessment-edvora.herokuapp.com/")
      .then((res) => res.json())
      .then((resp) => console.log(resp));
  }, []);

  return (
    <div className="app">
      <Filter />
      <ProductDisplay />
    </div>
  );
}

export default App;
